//github.com/js-esm/gez"}]},features:[{icon:"⚡️",title:"Core Engine",details:"High-performance SSR engine based on ESM Import Maps, supporting mainstream frameworks like Vue and React, providing complete server-side rendering capabilities."},{icon:"\uD83C\uDFAF",title:"Rendering Context",details:"Intelligent RenderContext system providing precise resource injection, state synchronization, and client-side hydration mechanisms to ensure optimal rendering performance."},{icon:"\uD83D\uDD17",title:"Module Linking",details:"Innovative module linking system supporting runtime dynamic loading, enabling precise dependency management and resource optimization."},{icon:"\uD83D\uDCE6",title:"Build System",details:"Flexible build configuration supporting multi-version output, pre-processing and post-processing hooks, enabling one-time build for multiple deployments."},{icon:"\uD83C\uDF0D",title:"Deployment Solutions",details:"Supports multi-language sites, dynamic base path configuration, and micro frontend architecture, allowing the same build artifacts to be deployed to any path."},{icon:"\uD83D\uDEE0️",title:"Development Experience",details:"Full TypeScript support, built-in hot module replacement and incremental builds, providing rich debugging tools and performance optimization guides."},{icon:"\uD83D\uDCBB",title:"Enterprise Applications",details:"Suitable for large-scale web applications, multi-language sites, and microservices architecture, supporting team collaboration and modular development."},{icon:"\uD83D\uDE80",title:"Performance Scenarios",details:"Optimized for performance-sensitive scenarios like e-commerce websites and news media, supporting SEO and first-screen loading optimization."},{icon:"\uD83C\uDF10",title:"Environment Support",details:"Supports Node.js 22.9+ and modern browsers, with full support for ESM dynamic import and import.meta."}]},version:"",_relativePath:"en/index.md",lastUpdatedTime:"3/7/2025, 12:14:55 PM"},{title:"@gez/rspack-vue",routePath: